import React, { useEffect, useState } from "react";
import { cartData } from "./components/CartData";

export const CartList = () => {
  const [items, setItems] = useState([]);

  useEffect(() => {
    setItems(cartData);
  });

  return (
    <table>
      <thead>
        <tr>
          <th>Product</th>
          <th>Quantity</th>
          <th>MRP(per Unit)</th>
          <th>Discount</th>
          <th>Total</th>
        </tr>
      </thead>
      <tbody>
        {items.map((item) => (
          <tr>
            <td>{item.title}</td>
            <td>{item.qty}</td>
            <td>{item.mrp}</td>
            <td>{item.discount}</td>
            <td>{100}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};
